import image1 from '../assets/image/image1.jpg'
import image2 from '../assets/image/image2.jpg'
import image3 from '../assets/image/image3.jpg'


export default [
	{
		image: image1,
		text: 'This is image 1'
	},

	{
		image: image2,
		text: 'This is image 2'
	},

	{
		image: image3,
		text: 'This is image 3'
	}
]
